import { Fragment } from 'react';
import classes from './Header.module.css';
import mealsImage from '../../assets/meals.jpeg'

const Header = props => {
  return (
  <Fragment>
    <header className={classes['header']}>
      <h1>React Meals</h1>
      <button>Cart</button>
    </header>

    <div>
        <img src='src/assets/meals.jpeg' />
    </div>
  </Fragment>
  );
};

export default Header
